import './Header.css';
import {Card} from "react-bootstrap";


function MyCard({title}) {

    return (
        <Card style={{ height: '120px' }} className="flex-row mx-md-4 ">
            <Card.Img variant="top" src="./logo192.png"  style={{ height: '100px', width: '100px' }}/>
            <Card.Body>
                <Card.Text>
                    {title}
                </Card.Text>
            </Card.Body>
        </Card>
    )
}

export  default MyCard;
